import React from "react";

const UserDropdown = ({ user, onLogout }) => {
  return (
    <div className="dropdown">
      <span style={{ marginRight: "10px", cursor: "pointer" }} id="usernameDropdown" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
        {user.name}
      </span>
      <div className="dropdown-menu" aria-labelledby="usernameDropdown">
        <a className="dropdown-item" href="#">Edit Profile</a>
        <div className="dropdown-divider"></div>
        <a className="dropdown-item" href="#" onClick={onLogout}>Logout</a>
      </div>
    </div>
  );
};

export default UserDropdown;
